import '../styling/Home.css';

function MyCourses() {
  return (
    <div className="Home">
      <header className="Home-header">
        <p>
          course stuff
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
  );
}

export default MyCourses;
